import zipfile
from io import BytesIO, StringIO


class TestDataGenerator(object):

    @staticmethod
    def get_zip_with_files(file_count):
        """
        zip Binary file like object with files
        :return: io.BytesIO
        """
        in_mem_zip_file = BytesIO()

        with zipfile.ZipFile(in_mem_zip_file, 'w') as zfi:
            for i in range(file_count):
                character = chr(ord('a') + i % 26)
                file_size = i * 1024 + 1
                file_name = 'test/dir{}/file.{}.{}.{}'.format(i, character, file_size, character)
                zfi.writestr(file_name, data=file_size * character)

        in_mem_zip_file.seek(0)
        return in_mem_zip_file

